    const [name, setName] = useState("");

    const handleSubmit = (event) => {
      event.preventDefault();
      console.log(name);
    };

    return (
      <form onSubmit={handleSubmit}>
        <input
          name="name"
          placeholder="Enter a name"
          value={name}
          onChange={(event) => setName(event.target.value)}
        />
        <button type="submit">Submit</button>
      </form>
    );
  }

  export default Form;
